import classes from './ProjectLink.mudle.css';

const ProjectLink = () => {
  return (
    <div className={classes.project}>
      <a href="https://github.com/shashiiitp19/Freshworks-Engineering-Assignment" target="_blank">
        An end-to-end Food ordering app has been developed with React basic fundamentals including
        CSS modules and Javascript.
      </a>
    </div>
  );
};

export default ProjectLink;
